import React from 'react';

import Link from 'next/link';

import { Navbar } from 'react-bootstrap';

// import { Container } from './styles';

export default function Manu() {
  return (
    <Navbar bg="light">
        <Link href="/"><Navbar.Brand>Brand link</Navbar.Brand></Link>
    </Navbar>
  );
}
